import { Menu } from "antd";
import Link from "next/link";

const MenuNavibarLayout = ({ menus }) => {
  return (
    <Menu mode="horizontal">
      {menus.map((menu) => (
        <Menu.Item>
          <Link href={`/menu/${menu}`}>
            <a>{menu}</a>
          </Link>
        </Menu.Item>
      ))}
    </Menu>
  );
};

export default MenuNavibarLayout;
